  `comment` varchar(100) DEFAULT NULL COMMENT '文件名称',
  `rzsj` datetime NOT NULL COMMENT '日志时间',
  `jybh` varchar(6) NOT NULL COMMENT '警员编号',
  `jyxm` varchar(60) DEFAULT NULL COMMENT '警员姓名',
  `gzz_ip` varchar(64) NOT NULL COMMENT '工作站ip',
